import React, { useEffect, useState } from 'react';
import { getCarsByUser } from '../services/api';

const CarList = ({ userId }) => {
    const [cars, setCars] = useState([]);

    useEffect(() => {
        getCarsByUser(userId).then(setCars).catch(console.error);
    }, [userId]);

    return (
        <div>
            <h2>Your Cars</h2>
            <ul>
                {cars.map((car) => (
                    <li key={car.id}>{car.title}</li>
                ))}
            </ul>
        </div>
    );
};

export default CarList;
